import { useState } from "react";

function App() {
  let [num, setNum] = useState();
  function multi() {
setNum()
  }
  return (
    <>
      <h3>구구단연습</h3>
      <form>
        <input value={num} type="number" min="0" max="9" readOnly />
        *
        <input type="number" min="0" max="9" readOnly />
        =
        <input type="number" min="0" max="99" />
      </form>
    </>
  );
}

export default App;
